const mongoose = require('mongoose');
const Campground = require('./models/campground');
const Comment = require('./models/comment');

const data = [
	{
		name: 'Clouds rest',
		image:
			'data:image/jpeg;base64,',
		description: 'First of our camping grounds'
	},
	{
		name: 'Maybe not Clouds rest',
		image:
			'data:image/jpeg;base64,',
		description: 'Second of our camping grounds'
	},
	{
		name: 'Possibly not Clouds rest',
		image:
			'data:image/jpeg;base64,',
		description: 'Third of our camping grounds'
	},
	{
		name: 'Definitely not Clouds rest',
		image:
			'data:image/jpeg;base64,',
		description: 'Fourth of our camping grounds'
	}
];

function seedDB() {
	Campground.remove({}, (err) => {
		if (err) {
			console.log(err);
		} else {
			console.log('removed campgrounds');
			data.forEach((seed) => {
				Campground.create(seed, (err, campground) => {
					if (err) {
						console.log(err);
					} else {
						console.log('added a campground');
						Comment.create(
							{
								text: 'This place is great, but i wish there was internat',
								author: 'Homer'
							},
							(err, comment) => {
								if (err) {
									console.log(err);
								} else {
									campground.comments.push(comment);
									campground.save();
									console.log('Created a new comment');
								}
							}
						);
					}
				});
			});
		}
	});
}
module.exports = seedDB;
